import React, { useState } from "react";
import BlueContainer from "../UI/BlueContainer";
import NavItem from "./NavItem";
import "./NavBar.css";
const NavBar = (props) => {
  const navItems = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];
  return (
    <BlueContainer>
      <div className="navbar">
        <div className="navbar-header">
          <div>Booking Website</div>
          <div>
            <button>Register</button>
            <button>Login</button>
          </div>
        </div>
        <div className="navbar-item">
          {navItems.map((navItem) => {
            <NavItem key={navItem.type} item={navItem} />;
          })}
        </div>
      </div>
    </BlueContainer>
  );
};

export default NavBar;
